(148, 'faleConosco', 'a:1:{i:0;s:5:"index";}', 'Fale Conosco editável', '<p>Fale com o chefe enquanto ele está online!</p>', '', '<p><br></p>', '', 1, 1, 1),
(149, 'faleComOChefe', 'a:1:{i:0;s:5:"index";}', 'Falar com o chefe! (editável)', '<p>Você pode falar com o Marcos agora mesmo, ele está disponível.&lt;br&gt;Aguarde um momento enquanto ele liga a webcam e pega um café...<br data-mce-bogus="1"></p>', '', '<p><br data-mce-bogus="1"></p>', '', 1, 1, 1),
(150, 'enviarMensagem', 'a:1:{i:0;s:5:"index";}', 'Enviar mensagem (editável)', '<p>Não está muito afim de papo? Envie sua mensagem ou entre em contato conosco abaixo:<br data-mce-bogus="1"></p>', '', '<p><br data-mce-bogus="1"></p>', '', 1, 1, 1),
