(15, 'contatos', 'Contato', 'Quer entrar em contato com a Imgstock? É muito simples! Cadastre seus dados nos campos abaixo, selecione um setor e envie-nos as suas ideias, observações, reclamações, dúvidas ou sugestões. <br/ > Vai ser um prazer conversar com você!', NULL, NULL, '', '', '1', '0', 'Seção de contatos', 0, 1, '1', 1),
