(26, 'home_search', 'Imagens fundo da pesquisa', '<p>Explore o universo de imagens da Imgstock</p>', NULL, NULL, 'Background Home', '<p>Explore o universo de imagens da Imgstock</p>', '0', '0', 'Sua busca começa aqui', 0, 1, '1', 1),
(27, 'precos_planos', 'Preços e Planos', '<p style="text-align: justify;">Oferecemos a voc&ecirc; um universo de imagens e vantagens! Confira os nossos pacotes, leia abaixo as observa&ccedil;&otilde;es importantes para realizar a sua compra e adquira logo os seus cr&eacute;ditos:</p>', '<h3><strong>Observa&ccedil;&otilde;es sobre a compra de cr&eacute;ditos:</strong></h3>\n<p>As imagens da Imgstock possuem um valor monet&aacute;rio baseado em cr&eacute;ditos, ou seja, cada imagem pode ser comprada por uma quantidade de cr&eacute;ditos.&nbsp;Esse valor est&aacute; relacionado a alguns aspectos espec&iacute;ficos, como o tamanho do arquivo, complexidade, cole&ccedil;&atilde;o pertencente, exclusividade, utiliza&ccedil;&atilde;o e ineditismo de conte&uacute;do. Deste modo, a rela&ccedil;&atilde;o entre moeda e cr&eacute;dito &eacute; feita de modo que cada<strong> 1 (um) cr&eacute;dito</strong> corresponda a um <strong>R$ 1,00 -&nbsp;</strong>moeda brasileira.</p>\n<p><strong>As suas compras de cr&eacute;ditos podem realizadas das seguintes formas:</strong></p>\n<p><strong>1.</strong> Atrav&eacute;s do valor final da imagem, ou seja, voc&ecirc; adquire os cr&eacute;ditos correspondentes ao pre&ccedil;o da imagem. Ex.: 49 cr&eacute;ditos = R$ 49,00.</p>\n<p><strong>2.</strong> Atrav&eacute;s de compras adiantadas por meio da aquisi&ccedil;&atilde;o de pacotes de cr&eacute;ditos. Esses cr&eacute;ditos ser&atilde;o descontados conforme o valor da imagem, em cada download que voc&ecirc; efetivar.</p>\n<p><strong>Vantagens:<br /></strong>Os pacotes de cr&eacute;ditos oferecem mais agilidade para usu&aacute;rios que adquirem imagens constantemente, al&eacute;m de possuir valores mais atrativos dependendo da quantidade adquirida.<br /><br /><strong style="text-align: justify;">Validade:<br /></strong><span style="text-align: justify;">Os cr&eacute;ditos expiram um ano ap&oacute;s a data da compra. Voc&ecirc; pode checar a quantidade de seus cr&eacute;ditos acessando seu cadastro e suas informa&ccedil;&otilde;es de conta.</span></p>', '', '', '<p>Description prices and plans</p>', '0', '0', 'Preços e Planos', 0, 1, '1', 1),
(28, 'tags', 'Tags', 'tags', NULL, NULL, 'tags', 'tags', '1', '0', '', 0, 1, '1', 1),
(29, 'faq_category', 'Categorias de FAQ', 'Clique em um dos campos abaixo para ter suas dúvidas respondidas:', NULL, NULL, '', 'faq_category', '1', '0', 'asdfasdf', 0, 1, '1', 1),
(31, 'politica_privacidade', 'Política de Privacidade', '<p style="text-align: justify;">A Imgstock &eacute; uma empresa de sublicenciamento de imagens. Ela est&aacute; sediada na cidade de Caxias do Sul, no Estado do Rio Grande do Sul &ndash; Brasil, e tem como um de seus principais compromissos a prote&ccedil;&atilde;o e o respeito da privacidade de seus clientes.</p>\n<p style="text-align: justify;">Deste modo, a <strong>Pol&iacute;tica de Privacidade e Termos de Uso</strong> definem os fundamentos e a conduta de relacionamento da empresa com os usu&aacute;rios do site, clientes e fornecedores. Ela apresenta o nosso comprometimento com os dados pessoais coletados no sistema ou fornecidos pelo usu&aacute;rio, na qual firmamos o compromisso de mant&ecirc;-los em sigilo e seguros em nosso banco de dados, instalado em servidores de alta tecnologia.</p>\n<p style="text-align: justify;">Recomendamos a leitura das cl&aacute;usulas seguintes para entender nossa vis&atilde;o, respeito e reciprocidade com voc&ecirc;.</p>\n<p style="text-align: justify;">&nbsp;</p>\n<p style="text-align: justify;"><strong>Informa&ccedil;&otilde;es coletadas com o usu&aacute;rio:<br /><br /></strong>Confira os dados que s&atilde;o coletados e processados pela Imgstock:</p>\n<ul style="text-align: justify; list-style-type: square;">\n<li style="text-align: justify;">Informa&ccedil;&otilde;es fornecidas pelo usu&aacute;rio atrav&eacute;s do preenchimento de formul&aacute;rios no site, incluindo os dados fornecidos no ato do registro para uso do site, envio de material ou solicita&ccedil;&atilde;o de outros servi&ccedil;os.</li>\n<li style="text-align: justify;">Detalhes de transa&ccedil;&otilde;es que voc&ecirc;/usu&aacute;rio realizar atrav&eacute;s do nosso site.</li>\n<li style="text-align: justify;">Detalhes das visitas dos usu&aacute;rios ao site, incluindo dados de tr&aacute;fego e de localiza&ccedil;&atilde;o, e outros dados de comunica&ccedil;&atilde;o, se estes forem necess&aacute;rios para os nossos prop&oacute;sitos.</li>\n<li style="text-align: justify;">A&nbsp;Imgstock reserva-se o direito de requerer a voc&ecirc;/usu&aacute;rio informa&ccedil;&otilde;es quando ocorrer qualquer problema em nosso site.</li>\n<li style="text-align: justify;">A empresa tamb&eacute;m poder&aacute; efetuar e manter um registro de correspond&ecirc;ncia, no momento em que voc&ecirc; entrar em contato conosco.</li>\n</ul>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Concord&acirc;ncia:<br /></strong></p>\n<ul style="list-style-type: square; text-align: justify;">\n<li style="text-align: justify;">Ao enviar-nos os seus dados pessoais, voc&ecirc;/usu&aacute;rio concorda com a transfer&ecirc;ncia, armazenamento ou processamento dessas informa&ccedil;&otilde;es, sendo que todos os dados fornecidos ser&atilde;o registrados em servidores seguros.</li>\n<li style="text-align: justify;">Todas as opera&ccedil;&otilde;es de pagamento ser&atilde;o criptografadas, usando-se das mais recentes tecnologias da internet.</li>\n<li style="text-align: justify;">Quando ocorrer a escolha e o registro de uma senha para acessar determinados itens de nosso site, voc&ecirc;/usu&aacute;rio se compromete que ser&aacute; o respons&aacute;vel por mant&ecirc;-la em confidencialidade. Pedimos que sua senha pessoal n&atilde;o seja compartilhada com ningu&eacute;m.</li>\n<li style="text-align: justify;">Reiteramos que tomaremos todas as medidas necess&aacute;rias para assegurar que seus dados se mantenham seguros e de acordo com esta Pol&iacute;tica de Privacidade.</li>\n</ul>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Usos:</strong></p>\n<p style="text-align: justify;">As informa&ccedil;&otilde;es obtidas e registras sobre voc&ecirc;/usu&aacute;rio ser&atilde;o utilizadas para:</p>\n<ul style="list-style-type: square; text-align: justify;">\n<li style="text-align: justify;">Assegurar que o conte&uacute;do de nosso site &eacute; apresentado de forma eficaz.</li>\n<li style="text-align: justify;">Fornecer informa&ccedil;&otilde;es, produtos ou servi&ccedil;os solicitados por voc&ecirc; ou que sejam do seu interesse.</li>\n<li style="text-align: justify;">Realizar nossas obriga&ccedil;&otilde;es de maneira satisfat&oacute;ria e que honrem os compromissos firmados entre voc&ecirc; e a empresa Imgstock.</li>\n<li style="text-align: justify;">Notific&aacute;-lo sobre mudan&ccedil;as em nosso servi&ccedil;o ou sistema.</li>\n<li style="text-align: justify;">Contat&aacute;-lo sobre a disponibilidade de produtos e servi&ccedil;os ofertados por n&oacute;s.</li>\n</ul>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Divulga&ccedil;&atilde;o:</strong></p>\n<p style="text-align: justify;">Fica estabelecido que n&oacute;s poderemos revelar suas informa&ccedil;&otilde;es pessoais a qualquer empresa membro do nosso grupo, que exista ou possa vir a ser criada, incluindo filiais, subsidi&aacute;rias ou holdings.</p>\n<p style="text-align: justify;">As suas informa&ccedil;&otilde;es pessoais poder&atilde;o ser reveladas a terceiros quando:</p>\n<ul style="list-style-type: square; text-align: justify;">\n<li style="text-align: justify;">A empresa Imgstock ou todos os seus ativos sejam adquiridos por terceiros, caso em que os dados pessoais de clientes ser&atilde;o um dos ativos transferidos.</li>\n<li style="text-align: justify;">A fim de cumprir qualquer obriga&ccedil;&atilde;o legal, aplicar e executar nosso Termo de Uso e outros acordos, ou para proteger os direitos, propriedade ou seguran&ccedil;a da Imgstock, nossos clientes e outros.</li>\n</ul>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Acesso &agrave; informa&ccedil;&atilde;o:<br /><br /></strong>A Legisla&ccedil;&atilde;o vigente no Pa&iacute;s lhe d&aacute; o direito de acesso &agrave;s informa&ccedil;&otilde;es mantidas sobre voc&ecirc;. Sendo que qualquer pedido de acesso poder&aacute; estar sujeito ao pagamento de uma taxa de custo de fornecimento destas informa&ccedil;&otilde;es.</p>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Mudan&ccedil;as:</strong></p>\n<p style="text-align: justify;">Quaisquer altera&ccedil;&otilde;es que poder&atilde;o ocorrer sobre nossa Pol&iacute;tica de Privacidade no futuro, ser&atilde;o publicadas nesta p&aacute;gina e, quando apropriado, notificado diretamente voc&ecirc;/usu&aacute;rio por e-mail.</p>\n<p style="text-align: justify;"><strong>&nbsp;</strong></p>\n<p style="text-align: justify;"><strong>Contato:</strong></p>\n<p style="text-align: justify;">Questionamentos, d&uacute;vidas e coment&aacute;rios relativos a esta <strong>Pol&iacute;tica de Privacidade e Termos de Uso</strong> devem ser dirigidas ao e-mail: <a href="mailto:atendimento@imgstock.com.br">atendimento@imgstock.com.br</a> ou para o endere&ccedil;o: Imgstock &ndash; Rua Luiz Cecconello, n&ordm; 631, Bairro Jardelino Ramos, Cep: 95020-400, Caxias do Sul &ndash; RS &ndash; Brasil.<br /><br />&nbsp;</p>', NULL, NULL, 'politica_privacidade', '<p>teste 222</p>', '0', '0', 'Teste', 0, 1, '1', 1),
