(34, 'Notícia 02', '<p><span>Aenean at est placerat, malesuada mi sed, faucibus dui. Mauris scelerisque et risus ac molestie. Sed imperdiet sem sit amet dolor porttitor rutrum. Quisque ac vestibulum arcu, in varius nisi. Curabitur ornare, dui quis aliquet aliquam, diam felis mattis arcu, eget dapibus risus diam eu sem. Phasellus interdum congue nulla, sed tempus lacus congue non. Duis rhoncus est et ligula fermentum tempor. Maecenas in sapien id tellus vestibulum commodo. Cras ornare rhoncus eros vel lobortis. In posuere accumsan porta. Mauris fermentum odio laoreet dictum gravida. Morbi dictum lacus a tellus dapibus, vel dictum magna adipiscing.</span></p>', '', '', '', '', '0000-00-00', 0, 33, '1', '1');
